import React from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      random: null
    };
  }
  render() {
    return <div className="App">lalalalala</div>;
  }
}

export default App;
